import axios from 'axios';
import React, { Component } from 'react';

import { localStorageGet, localStorageSet } from '../../../../StorageGS';

import './index.scss'

export default class index extends Component {
    componentDidMount() {
        if(this.props.location.state.keyword === '') {
            let keyword = localStorageGet("keyword", this.props.location.state.keyword)
        }else {
            let keyword = this.props.location.state.keyword
        }
        
        axios.get('http://api.bilibili.com/x/web-interface/search/all/v2', { params: {
            keyword
        } })
        .then( function(response) {
            console.log(response)
        })
        .catch( function(err) {
            console.log(err)
        })
    }

    render() {
        return (
            <div className="results">
                
            </div>
        )
    }
}
